private NamedList<Double> extractPercentils(SolrQueryResponse rsp, String key) {
  return ((NamedList<NamedList<NamedList<NamedList<Double>>>> )
          rsp.getValues().get("stats")).get("stats_fields").get(key).get("percentiles");
}

